script: |
  super -f text -I q3245.spq | sort > q3245.out

inputs:
  - name: q3245.spq
    data: |
      SELECT DISTINCT - col1 * + 12 + - ( + cor0.col0 ) * - col2 + 86 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q3245.out
    data: |
      -64
      3614
      7610
